    "2016-05-27T02:33:06.705511",nt"name": "state-fairgrounds",nt"isopen":
    false,nt"url": null,nt"notes": "This shapefile is a point shapefile that
    displays the locations of the major state/regional agricultural fairs held throughout
    the United States. Some states (e.g., Alaska) have multiple state fairground sites.
    Hawaii holds its main state fair event at the Aloha Bowl, but does not have any
    other specific state fairground facility. Rhode Island and Connecticut do not hold
    specific state fair events--just regional events. In summary, 47 states have at
    least 1 record within this database, while Hawaii, Connecticut, and Rhode Island
    are not represented. There are no state fair events represented in any of the major
    U.S. territories (e.g., Puerto Rico).",nt"license_title": "License Not Specified",nt"extras":
